css:
.console .icons {
  display: flex;
  flex: none;
}
.console .header {
  border: 1px solid #ffffff;
  background-color: #fafafa;
  display: flex;
  justify-content: space-between;
}
.console .header .name {
  margin: 0 0 0 2px;
  cursor: default;
  height: 16px;
}
.console .bold {
  font-weight: bold;
}
.console .filelink:hover {
  text-decoration: underline;
  cursor: pointer;
}
.console .input-container {
  margin: 2px;
}
.console .output-container {
  position: relative;
  margin: 1px;
  height: 200px;
  overflow-y: scroll;
  font-family: monospace;
  white-space: pre-wrap;
  background-color: #ffffff;
}
.console .hidden {
  display: none;
}
.console .error {
  color: #ee521a;
}
.console .tabs {
  position: absolute;
  z-index: 10;
  margin-left: 1px;
}
.console .tabs .icon-three-bars {
  position: relative;
  top: 5px;
  left: 5px;
}
.console .tabs .tab-list {
  display: none;
}
.console .tabs:hover {
  background-color: #fafafa;
  list-style: none;
}
.console .tabs:hover .tab-list {
  position: relative;
  display: block;
  padding: 10px;
}
.console .tabs:hover .tab-list .active {
  background-color: #51b9db;
  color: #ffffff;
}
.console .tabs:hover .tab-list .command-item {
  display: flex;
  justify-content: space-between;
  cursor: pointer;
  line-height: 25px;
  padding-left: 5px;
}
.console .tabs:hover .tab-list .command-item .icon-check:before {
  color: #32bf32;
}
.console .tabs:hover .tab-list .command-item .icon-x:before {
  color: #ee521a;
}
.console .tabs:hover .tab-list .command-item .loading-spinner-tiny {
  margin-top: 2px;
}
.console .tabs:hover .tab-list .command-item .clicker {
  display: flex;
  flex: 1;
}
.console .tabs:hover .tab-list .command-item .close {
  margin-left: 5px;
}
.console .tabs:hover .tab-list .command-item:hover {
  background-color: #dddddd;
  color: #666666;
}
.console .tabs:hover .tab-list .command-item:active {
  background-color: #51b9db;
  color: #ffffff;
}
